from typing import List

class Solution:
    def kWeakestRows(self, mat: List[List[int]], k: int) -> List[int]:
        rows = len(mat)
        cols = len(mat[0])
        arr = [[] for _ in range(cols + 1)]
        for r in range(rows):
            cnt = mat[r].count(1)
            arr[cnt] += [r]
        res = list()
        for item in arr:
            if len(item) > 0:
                for i in item:
                    res += [i]
                    k -= 1
                    if k == 0:
                        return res

